  const RedirectToMainPage = () =>{
      //history.push("");
  }

  return (
    <div>
        <Router>
            <Route exact path="/MainPage">
              <MainPage/>
            </Route>
        </Router>
        Welcome to my card game!
        <button onClick={RedirectToMainPage}>Press to enter</button>
    </div>
    
  )
}

export default EntryPage
